import React from 'react';
import { MDBCard, MDBCardImage, MDBCardBody, MDBCardTitle, MDBCardText, MDBCardFooter, MDBRow, MDBCol } from 'mdb-react-ui-kit';

  import { MDBBtn, MDBIcon } from 'mdb-react-ui-kit';
  import projects from '../../projects.json'



function Projects() {
    return (
      <>
      

           



                {projects.map((project) => (

                <MDBRow className='row-cols-1 row-cols-md-3 g-4'>
      <MDBCol>
        <MDBCard className='h-100'>
          <MDBCardImage
            src={project.image}
            alt='...'
            position='top'
          />
          <MDBCardBody>
            <MDBCardTitle>{project.name}</MDBCardTitle>
            
          </MDBCardBody>
          <MDBCardFooter>
          <MDBBtn className='m-1' style={{ backgroundColor: '#333333' }} href={project.github}>
                                    <MDBIcon fab icon='github' />
                                </MDBBtn>
                                <MDBBtn className='m-1' style={{ backgroundColor: '#0082ca' }} href={project.online}>
                                    <MDBIcon fab icon='dribbble' />
                                </MDBBtn>
          </MDBCardFooter>
        </MDBCard>
      </MDBCol>
      
      
    </MDBRow>



))}




             




           
    </>
    );
  }
  
  export default Projects;
